import { Link } from "react-router-dom";
import chatIcon from "../img/chatIcon.png";

export default function Layout(){
    return(
        <>
            <Link to="/chat" className="chatIcon">
                <img src={chatIcon}/>
            </Link>
        </>
    )
}
